cles.articles_order','','1','insert',1,'2011-09-10 14:45:38'),(38,'articles','insert',10,'cae_articles.articles_intro','','Situé au 157, rue du centre industriel à BASSA DOUALA, SECA (Services Camerounais d’Assainissement), est une société anonyme  de droits camerounais exerçant sur toute l’étendue du territoire.\r\nNé en 1979 de la volonté du groupe HYSACAM de pouvoir desservir le secteur industriel, l’entreprise s’est positionnée depuis de nombreuses années comme acteur de référence dans la gestion environnementale au Cameroun.','insert',1,'2011-09-10 14:45:38'),(38,'articles','insert',10,'cae_articles.articles_categories_id','','5','insert',1,'2011-09-10 14:45:38'),(38,'articles','insert',10,'cae_articles.articles_image','','dir_cae.jpg2.jpg','update',1,'2011-09-10 14:45:38'),(38,'articles','insert',10,'cae_articles_description.articles_id','','10','insert',1,'2011-09-10 14:45:38'),(38,'articles','insert',10,'cae_articles_description.language_id','','2','insert',1,'2011-09-10 14:45:38'),(38,'articles','insert',10,'cae_articles_description.content_name','','A Propos de SECA','insert',1,'2011-09-10 14:45:38'),(38,'articles','insert',10,'cae_articles_description.articles_url','','a-propos-de-cae','insert',1,'2011-09-10 14:45:38'),(38,'articles','insert',10,'cae_articles_description.articles_description','','<p>&nbsp;</p>\r\n<p style=\"margin-bottom: 0in; line-height: 0.25in;\" align=\"JUSTIFY\">Situ&eacute; au 157, rue du centre industriel &agrave; BASSA DOUALA, SECA (Services Camerounais d&rsquo;Assainissement), est une soci&eacute;t&eacute; anonyme  de droits camerounais exer&ccedil;ant sur toute l&rsquo;&eacute;tendue du territoire.</p>\r\n<p style=\"margin-bottom: 0in; line-height: 0.25in;\" align=\"JUSTIFY\">N&eacute; en 1979 de la volont&eacute; du groupe HYSACAM de pouvoir desservir le secteur industriel, l&rsquo;entreprise s&rsquo;est positionn&eacute;e depuis de nombreuses ann&eacute;es comme acteur de r&eacute;f&eacute;rence dans la gestion environnementale au Cameroun.</p>\r\n<p style=\"margin-bottom: 0in; line-height: 0.25in;\" align=\"JUSTIFY\">Gr&acirc;ce &agrave; l&rsquo;&eacute;tendue de son offre, SECA con&ccedil;oit et propose des solutions de tr&egrave;s haut niveau technique, innovantes, s&ucirc;res et sur mesure, respectueuses de l&rsquo;homme et de l&rsquo;environnement.</p>\r\n<p style=\"margin-bottom: 0in; line-height: 0.25in;\" align=\"JUSTIFY\">Le partenariat  technique sign&eacute; avec le groupe VEOLIA ouvre de nouvelles perspectives &agrave; SECA, lui permettant ainsi d&rsquo;innover chaque jour ses prestations en droite ligne des pr&eacute;occupations environnementales.</p>\r\n<p style=\"margin-bottom: 0in; line-height: 0.25in;\" align=\"JUSTIFY\">SECA anime au sein du groupement interprofessionnel du Cameroun (GICAM) la cellule d&eacute;chets du Comit&eacute; Technique Environnement.</p>','insert',1,'2011-09-10 14:45:38'),(38,'articles','insert',10,'cae_articles_description.articles_page_title','','','insert',1,'2011-09-10 14:45:38'),(38,'articles','insert',10,'cae_articles_description.articles_meta_keywords','','','insert',1,'2011-09-10 14:45:38'),(38,'articles','insert',10,'cae_articles_description.articles_meta_description','','','insert',1,'2011-09-10 14:45:38'),(39,'articles','insert',11,'cae_articles.articles_date_added','','now()','insert',1,'2011-09-10 14:50:25'),(39,'articles','insert',11,'cae_articles.articles_status','','1','insert',1,'2011-09-10 14:50:25'),(39,'articles','insert',11,'cae_articles.articles_order','','','insert',1,'2011-09-10 14:50:25'),(39,'articles','insert',11,'cae_articles.articles_intro','','Le porte feuille client de SECA compte un plus de 100 entreprises et particuliers qui se recrutent dans des secteurs d’activités variés tels que :\r\nLe pétrole\r\nL’hôtellerie \r\nL’aéroportuaire\r\nL’industrie textile \r\nL’industrie agroalimentaire \r\nEtc.*','insert',1,'2011-09-10 14:50:25'),(39,'articles','insert',11,'cae_articles.articles_categories_id','','6','insert',1,