insert  into `cae_email_templates_description`(`email_templates_id`,`language_id`,`email_title`,`email_content`) values (1,2,'Bienvenue à %%store_name%%','<p>%%greeting_text%%</p><br /><br /><p>Nous vous souhaitons la bienvenue à %%store_name%% !</p><br /><br /><p>Vous pouvez maintenant utiliser les différents services que nous offrons, parmi :</p><br /><br /><ul><br /><li>Panier permanent - Chaque produit ajouté à votre panier en ligne reste présent tant que vous ne le supprimez pas.</li><br /><li>Carnet d\\\'adresses - Nous pouvons livrer vos produits à une autre adresse que la votre. C\\\'est une occasion parfaite pour envoyer des cadeaux à des personnes tierces.</li><br /><li>Historique de commandes - Visualisezvotre historique d\\\'achats chez nous.</li><br /><li>Commentaires produits - Partagez vos opinions sur les produits avec les autres clients.</li><br /></ul><br /><p>En cas d\\\'aide pour n\\\'importe quel service en ligne, envoyez un email à la boutique : %%store_owner_email_address%%.</p><br /><br />Note : Cette adresse email nous a été donnée par un client. Si vous ne vous enregistrez pas comme membre,  veuillez envoyer un email à la boutique.'),(2,2,'Mémo mot-de-passe à Mefobecart','Un nouveau mot-de-passe a été demandé de %%customer_ip_address%%<br /><br />Votre nouveau mot-de-passe à %%store_name%% est :<br /><br />%%customer_password%%<br /><br />En cas de besoin d\'aide, veuillez envoyer un email à la boutique : %%store_owner_email_address%%.<br /><br />Note : Si vous n\'avez pas demandé cette action via notre page d\'oubli de mot-de-passe, veuillez le notifier tout de suite à la boutique.'),(3,2,'Votre ami %%from_name%% vous recommande ce produit de %%store_name%%','Salut %%to_name%% !<br /><br />Votre ami, %%from_name%%, a pensé que vous seriez intéressé par %%product_name%% de %%store_name%%.<br /><br />%%message%%<br /><br />Pour visualiser le produit, cliquez sur le lien ci-dessous ou faites un copier/coller du lien dans votre navigateur :<br /><br />%%product_link%%<br /><br />Cordialement<br /><br />%%store_name%%<br />%%store_address%%'),(4,2,'Récapitulatif commande','TomatoCart<br />------------------------------------------------------------<br />Numéro de commande : %%order_number%%<br />Détail facture : %%invoice_link%%rnCommandé le : %%date_ordered%%<br /><br />%%order_details%%<br /><br />Adresse de livraison<br />-------------------------------------------------------------<br />%%delivery_address%%<br /><br />Adresse de facturation<br />-------------------------------------------------------------<br />%%billing_address%%<br /><br />Statut de la commande : %%order_status%%<br />-------------------------------------------------------------<br />%%order_comments%%'),(5,2,'Mise à jour commande (%%store_name%%)','%%store_name%%<br />------------------------------------------------------------------<br />Numéro de commande : %%order_number%%<br />Détail facture : %%invoice_link%%<br />Commandée le : %%date_ordered%%<br /><br />Commentaire commande<br />------------------------------------------------------------------<br />%%order_comment%%<br /><br />Statut commande<br />-----------------------------------------------------------------<br />Nouveau statut : %%new_order_status%%<br /><br />Vous pouvez répondre à cet email si vous avez des questions par rapport à cette commande.'),(6,2,'Bienvenue à %%store_name%%','%%greeting_text%%<br /><br />Nous vous souhaitons la bienvenue à %%store_name%% !<br /><br />Vous pouvez maintenant utiliser les différents services que nous offrons, parmi :<br /><br />* Panier permanent - Chaque produit ajouté à votre panier en ligne reste présent tant que vous ne le supprimez pas.<br />* Carnet d\'adresses - Nous pouvons livrer vos produits à une autre adresse que la votre. C\'est une occasion parfaite pour envoyer des cadeaux à des personnes tierces.<br />* Historique de commandes - Visualisezvotre historique d\'achats chez nous.<br />* Commentaires produits - Partagez vos opinions sur les produits avec les autres clients<br /><br />En cas d\'aide pour n\'importe quel service en ligne, envoyez un email à la boutique : %%store_owner_email_address%%<br />Note : Ce compte a été créé pour vous par la boutique. <br /><br />Veuillez utiliser votre adresse email avec le mot-de-passe suivant comme identifiants de login : %%password%%'),(7,2,'Requête de %%store_name%%','%%greeting_text%%<br /><br />Nous nous sommes aperçus que lors d\'une visite dans notre boutique en ligne, vous avez placé les produits suivants dans votre panier, mais que vous n\'avez pas finalisé l\'achat.<br /><br />Produits :<br /><br />%%shopping_cart_contents%%<br /><br />Nous sommes toujours intéressés pour savoir ce qu\'il s\'est passé et connaitre la raison pour laquelle vous n\'avez finalement pas acheté les produits. Vos commentaires seraient donc les bienvenus afin de recueillir vos impressions et améliorer votre satisfaction chez %%store_name%%.<br /><br />VEUILLEZ NOTER :<br /><br />Si vous aviez effectivement complété votre achat et vous n\'avez pas été livré, cet email est une indication  que la commande n\'a PAS été finalisée, retournez donc dans votre espace personnel pour finaliser l\'achat.<br /><br />Veuillez nous excuser par avance si vous avez complété votre achat, vous faisons tout notre possible pour ne pas importuner nos clients par erreur.<br /><br />Merci encore pour votre temps et vos commentaires afin d\'améliorer la qualité de la prestation chez %%store_name%%<br /><br />%%additional_message%%<br /><br />Cordialement,<br />%%store_name%%'),(8,2,'Vous avez reçu un coupon de la part de %%store_name%%','%%greeting_text%%<br /><br />Vous avez reçu un coupon de %%store_name%%. Vous pouvez effectuer le remboursement de ce code coupon pendant la commande. Indiquez simplement le code dans la case correspondante, et cliquez sur le bouton Remboursement.<br /><br />Le code coupon est %%coupon_code%%<br /><br />Ne perdez pas ce code coupon, faites en sorte de l\'enregistrer quelque part afin de bénéficier de cette offre spéciale.<br /><br />%%additional_message%%'),(9,2,'Vous avez reçu un avoir de la part de l\'administrateur','%%greeting_text%%<p>L\'administrateur a mis à jour vos avoirs. Vous avez maintenant %%customer_credits%% crédits sur votre compte</p>'),(10,2,'Votre ami %%from_name%% voudrait partager avec vous sa liste d\'envies chez %%store_name%%','Bonjour !<br /><br />Votre ami %%from_name%% voudrait partager avec vous sa liste de souhaits chez %%store_name%%<br /><br />%%message%%<br /><br />Pour visualiser la liste de souhaits, cliquez sur le lien ci-dessous ou faites un copier/coller du lien dans votre navigateur :<br />%%wishlist_url%%<br /><br />Cordialement,<br /><br />%%store_name%%<br />%%store_address%%'),(11,2,'Vous avez reçu un bon cadeau de la part de %%sender_name%%','Cher %%recipient_name%%,<br /><br />Vous avez reçu un bon cadeau de %%sender_name%%. Vous pouvez utliser ce bon cadeau pendant la commande. Entrez simplement le code et cliquez sur le bouton Rembourser.<br /><br />Le montant du bon cadeau est de %%gift_certificate_amount%% et le code du bon cadeau est %%gift_certificate_code%%<br /><br />Ne perdez pas ce code bon cadeau et enregistrez le quelque part.<br /><br /><b>%%gift_certificate_message%%</b><br /><br />Cordialement,<br /><br />%%store_name%%<br />%%store_owner_email_address%%'),(12,2,'Le lien pour télécharger %%downloadable_products%% est activé','Cher %%customer_name%%,<br /><br />Le lien pour télécharger les produits que vous avez acheté chez %%store_name%% :<br /><br />%%downloadable_products%%<br /><br />est activé.<br /><br />Veuillez aller dans le segment des commandes de \"Mon Compte\" et télécharger les produits.<br /><br />%%download_link%%<br /><br />Cordialement,<br /><br />%%store_name%%<br />%%store_owner_email_address%%'),(13,2,'Un nouvel avoir a été créé pour les produits retournés','Cher %%customer_name%%,<br /><br />Un nouvel avoir a été créé pour les produits retournés suivants :<br /><br />%%returned_products%%<br /><br />de la commande %%order_number%%. Le nouvel avoir est de %%slip_number%% et le montant total est %%total_amount%%. Vous pouvez aussi imprimer l\'avoir depuis la partie \"Mon compte\".<br /><br />Cordialement,<br /><br />%%store_name%%<br />%%store_owner_email_address%%'),(14,2,'Un nouveau crédit a été créé suite au retour de produits','Cher %%customer_name%%<br /><br />Un nouveau crédit a été créé suite au retour des produits suivants :<br /><br />%%returned_products%%<br /><br />de la commande %%order_number%%. Le montant total est de %%total_amount%% et le crédit a été effectué sur votre compte de façon à être utilisé lors d\'achats futurs.<br /><br />Cordialement,<br /><br />%%store_name%%<br />%%store_owner_email_address%%'),(15,2,'Mémo mot-de-passe administrateur à Mefobecart','Un nouveau mot-de-passe a été demandé de %%admin_ip_address%%.<br /><br />Votre nouveau mot-de-passe est :<br /><br />%%admin_password%%<br /><br />Cordialement,<br /><br />%%store_name%%<br />%%store_owner_email_address%%'),(16,2,'Product out of Stock','TomatoCart<br>---------------------------------------------------<br>%%products_name%% %%products_variants%% is out of stock.<br>---------------------------------------------------<br>Remaining stock: %%products_quantity%%. You are advised to turn <br>to the Products section in the admin panel to replenish the inventory.');



