ute;tendue de son offre, SECA con&ccedil;oit et propose des solutions de tr&egrave;s haut niveau technique, innovantes, s&ucirc;res et sur mesure, respectueuses de l&rsquo;homme et de l&rsquo;environnement.</p>\n<p style=\"margin-bottom: 0in; line-height: 0.25in;\" align=\"JUSTIFY\">Le partenariat  technique sign&eacute; avec le groupe VEOLIA ouvre de nouvelles perspectives &agrave; SECA, lui permettant ainsi d&rsquo;innover chaque jour ses prestations en droite ligne des pr&eacute;occupations environnementales.</p>\n<p style=\"margin-bottom: 0in; line-height: 0.25in;\" align=\"JUSTIFY\">SECA anime au sein du groupement interprofessionnel du Cameroun (GICAM) la cellule d&eacute;chets du Comit&eacute; Technique Environnement.</p>'),(1170,2,'general','listing_image_heading','Image'),(1171,2,'general','listing_sku_heading','Référence'),(1172,2,'general','listing_products_heading','Produits'),(1173,2,'general','listing_manufacturer_heading','Partenaires'),(1174,2,'general','listing_quantity_heading','Quantité'),(1175,2,'general','listing_price_heading','Prix'),(1176,2,'general','listing_weight_heading','Poids'),(1177,2,'general','listing_buy_now_heading','Acheter maintenant'),(1178,2,'general','products_attributes_filter','Attributs du produit'),(1179,2,'general','no_products_in_category','Il n\'y a aucun produit disponible dans cette catégorie.'),(1180,2,'general','filter_show','Afficher:'),(1181,2,'general','filter_all_categories','Toutes les catégories'),(1182,2,'general','close_panel','Fermer le panneau'),(1183,2,'general','hello_guest','Bonjour cher visiteur !'),(1184,2,'general','register','S\'enregistrer'),(1185,2,'general','welcome','Bienvenue'),(1186,2,'general','filter_all_manufacturers','Tous les partemaires'),(1187,2,'index','greeting_guest',''),(3134,2,'index','guest_book','Vos doleances'),(1188,2,'index','greeting_customer',''),(3132,2,'modules-boxes','box_polls_heading','Sondages'),(3133,2,'modules-boxes','box_guest_book_heading','Temoignages'),(1189,2,'g